<section class="section-2">
  <section>
    <h2 class="medium section-2-header">Wie ik ben en wat ik doe</h2>
    <p class="extra-small">
      Ik ben <strong>19 jaar</strong> en woon in <strong>Volendam</strong>. Ik studeer <strong>Frontend Design & Web Development</strong> aan de <strong>HvA</strong>, waar ik leer websites te maken die er goed uitzien en prettig werken voor <strong>iedereen</strong>.
    </p>
    
    <p class="extra-small">
      Ik houd van <strong>ondernemen</strong> en droom ervan <strong>ZZP’er</strong> te worden, zodat ik zelf mijn <strong>keuzes</strong> kan maken (zoals lekker op <strong>vakantie</strong> gaan ;-) ) en <strong>projecten</strong> kan doen die bij mij passen. Buiten school leer ik veel door <strong>LinkedIn-posts</strong> te bekijken, <strong>nieuwsbrieven</strong> te lezen en tutorials op <strong>YouTube</strong> te volgen. Zo heb ik laatst in de vakantie een <strong>JavaScript-diploma</strong> gehaald.
    </p>
  </section>

